import React, { Component } from "react";
import { MainHeader } from "../Components/MainBackground";


class LogIn extends Component {
  render() {
    return (
      <MainHeader>
        <h2>Log In</h2>
      </MainHeader>
    );
  }
}

export default LogIn;
